const modal = (props) => {
  return (
    <>
    <div className="model-overlay" onClick={props.fecharModal}></div>
    <div className="model">
      <h1>{props.titulo}</h1>
      <div className="model_conteudo">
        {props.tipoModel === "descricaoEvento"}
      </div>
    </div>
    </>
  )
}

export default modal;
